import './App.css';
import Home from "./components/Home"

function App() {
  return (
    <div className="App">
      <Router>
        <nav className="sidebar">
          <NavLink className="links" to="/">Home</NavLink>
        </nav>
          <Switch>
            <Route path="/">
              <Home/>
            </Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
